import { NavLink } from "react-router-dom";

const Navbar = () => {
  return <div>

        <div className="flex flex-row justify-between">
          <NavLink to="/"><img src="" alt="err" /></NavLink>
            <div className="flex row gap-3">
              <p>Home</p>
              <NavLink to="/cart">
              <p>+Cart </p>
              </NavLink>
            </div>
        </div>

  </div>;
};

export default Navbar;
